import React,{Component} from 'react';
import { Row, Col, Divider,Layout ,Typography,Button, Menu} from 'antd';
import { SearchOutlined, ReadOutlined, FormOutlined  ,QuestionCircleOutlined} from '@ant-design/icons';
class Jobs extends Component{
    render(){
        return(
            <main className="index">
                 <Layout>
                  <Row gutter={16}>
                      <Col className="gutter-row" span={6}>
                        <div className="side-menu">
                            <Menu
                              onClick={this.handleClick}
                              style={{ width: 256 }}
                              defaultSelectedKeys={['1']}
                              defaultOpenKeys={['sub1']}
                              mode="inline"
                              >
                                  <Menu.Item key="2"><FormOutlined />Ask Question</Menu.Item>
                                  <Menu.Item key="3"><Link href="/"><a><ReadOutlined/>Blogs</a></Link></Menu.Item>
                                  <Menu.Item key="4"><SearchOutlined/>Question & Answer</Menu.Item>
                                  <Menu.Item key="1"><Link href="/jobs"><a><QuestionCircleOutlined />Jobs</a></Link></Menu.Item>
                              </Menu>
                        </div>
                      </Col>
                      <Col className="gutter-row" span={12}>
                        Jobs
                      </Col>
                      <Col className="gutter-row" span={6}>
                        <div >col-6</div>
                      </Col>
                  </Row>
              </Layout>
            </main>
        )
    }
}

export default Jobs;
